import React from 'react';
import { NavLink } from 'react-router-dom';

const HomePage=()=>{
    return (<>
        <div>Home Page</div>
        <div>
            <NavLink to='/student'></NavLink>
            <NavLink to='/teacher'></NavLink>
        </div>
        </>
    )
}


export default HomePage
